import React from "react";
import "./footer.css";
import { Container, Row, Col } from "reactstrap";

import { Link } from "react-router-dom";
import logo from "../../assets/images/logotouru.png";

const quick__links = [
  {
    path: "/home",
    display: "Beranda",
  },
  {
    path: "/tours",
    display: "Tour Guide",
  },
  {
    path: "/homestay",
    display: "Homestay",
  },
];

const quick__links2 = [
  {
    path: "/register",
    display: "Register",
  },
  {
    path: "/login",
    display: "Login",
  },
];

const Footer = () => {
  return (
    <footer className="footer">
      <Container>
        <Row>
          <Col lg="3">
            <div className="logo">
              <img src={logo} alt="" />
            </div>
          </Col>
          <Col>
            <div className="social__links d-flex align-item-center gap-4">
              <span>
                <link to="#" />
                <i class="ri-twitter-fill"></i>
              </span>
              <span>
                <link to="#" />
                <i class="ri-linkedin-box-fill"></i>
              </span>
              <span>
                <link to="#" />
                <i class="ri-youtube-fill"></i>
              </span>
            </div>
          </Col>
        </Row>
        <div style={{ background: "black", height: "3px" }}></div>
      </Container>
    </footer>
  );
};

export default Footer;
